import React from 'react';
import ReactDOM from "react-dom";
import { createStore, applyMiddleware } from 'redux';
import { Provider } from 'react-redux';
import rootReducer from './reducers';
import thunk from 'redux-thunk';
import App from './App';
import Header from './containers/Header';
import  '../src/style.css';

import { Container, Row, Col, Navbar, Nav, NavDropdown, Carousel, Image } from 'react-bootstrap';

import * as bs from 'bootstrap/dist/css/bootstrap.min.css';



class App2 extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            isLogin : false,
            user : {},
            users : [],
            donationRequest : [],
        }
    }

    render() {
        return (
            <Router>
                <div className="App">
                    <Header/>




                    <Container  className="content mt-4">
                        <Row>
                        <Col md={6}>
                            <Image src="https://images.unsplash.com/photo-1542884841-9f546e727bca?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60" rounded/>
                        </Col>
                        <Col md={6} className="mt-5">
                            <div class="para-1">
                                <div className="para-1-header">
                                    <h1>Blood Sharing</h1>
                                </div>
                                <div className="para-1-content">
                                    <label>Blood is Need for EveryOne</label>
                                    <p>lormem  Lorme Hello whero seiee!! sss lorem lorem lorem Our team is support for Every One who need blood!!!</p>
                                </div>
                            </div>
                        </Col>

                        </Row>
                    </Container>
                </div>

                <h1>Welcome to Blood Sharing!</h1>
                <Link to="/">Home</Link> | <Link to="/register">Register</Link> | <Link to="/login">Login</Link> | <Link to="/donate">Donate</Link> | <Link to="/blood/request">Request</Link>

                <Route path="/register" render={ props => (<RegisterForm {...props} />)} />
                <Route path="/login" render={ props => (<LoginForm {...props} />)} />
                <Route exact path="/donate" render={ props => (<DonationForm {...props} />)} />
                <Route exact path   ="/donate/next" render={ props => (<DonationSecondForm {...props} />)} />
                <Route path="/blood/request" render={ props => (<BloodRequestForm {...props} />)} />
                <Route exact path="/donor" render={ props => (<DonorPage {...props} />)} />
            </Router>
        )
    }
}

const rootElement = document.getElementById("root");
const store = createStore(rootReducer,applyMiddleware(thunk))  ;
ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  rootElement
);
